import React from 'react';
import { Link } from 'react-router-dom';
import { Card } from 'react-bootstrap';

const Bike = ({ bike }) => {
  return (
    <Card className="my-3 p-3 rounded">
      <Link to={`/product/${bike._id}`}>
        <Card.Img src={bike.image} variant="top" />
      </Link>

      <Card.Body>
        <Link to={`/bike/${bike._id}`}>
          <Card.Title as="div">
            <strong>{bike.name}</strong>
          </Card.Title>
        </Link>

        <Card.Text as="div">
          <Rating value={bike.rating} text={`${bike.numReviews} reviews`} />
        </Card.Text>

        <Card.Text as="h3">â‚¬{bike.price}</Card.Text>
      </Card.Body>
    </Card>
  );
};

export default Bike;
